import styled from 'styled-components'
import './styles/theme.css';

function App() {

  return (
    <div className='test'>
      <Button>Testing</Button>
    </div>
  );
}

const Button = styled.button`
  background: transparent;
  border-radius: 3px;
  border: 2px solid #BF4F74;
  margin: 0 1em;
  padding: 0.25em 1em;

  ${props =>
    props.$primary &&
    css`
      background: '#BF4F74';
      color: white;
    `};
`

export default App;
